import '../styles/Navbar.css';

function Navbar() {
    return (
        <div className='nav'>

            <header className='header'>

                <a href='#' className='logo'>Logo</a>

                <navbar className='navbar'>
                    <a href='#'>Home</a>
                    <a href='#'>About</a>
                    <a href='#'>Portfolio</a>
                    <a href='#'>Services</a>
                    <a href='#'>Home</a>
                </navbar>

            </header>

        </div>
    )
}

export default Navbar;
